import React from 'react';
import {sum,sub,mul,div} from './Calc';


function App(){
   return(
       <ol>
       <li>Sum is {sum(40,4)}</li>
       <li>Sub is {sub(55,5)}</li>
       <li>Mul is {mul(2,5)}</li>
       <li>Div is {div(9,13)}</li>
   </ol>
       )
}
    

export default App;
